import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
      UserFullDetail: null,

      LoadedEvents: [
        {id: '123aa',
          title: 'ILERIS April Edition',
          imageUrl: 'data:image/jpeg;base64,',
          date: "23rd April, 2020",
          venue: "CITAD Building",
          time: '10:00am',
          description: "A Monthly seminar conducted in CITAD, Distint Head, Alh. Rabi'u Rogo as guest speaker who will talk about the history of his life, the struggles, academic life etc",
          host: 'Kamal Salis'
        },
        {id: '123ab',
          title: 'Kano Social Influncer Summit 2019',
          imageUrl: 'data:image/jpeg;base64,',
          date: "20th February, 2019",
          venue: "CITAD, NSITF Building, Behind Trade Fair Complex Kano",
          time: '02:20pm',
          description: 'A program organised by CITAD to make use of talented IT student as a whole team, to give them space to explore their ideas, skills and even share the IT tools among them',
          host: 'Shamsudden Ghali'
        },
        {id: '123ac',
          title: 'How IT impact the life of young Youth, Women in Leadership',
          imageUrl: "data:image/jpeg;base64,",
          date: "20th February, 2020",
          venue: "Mambayya House Gwammaja",
          time: '10:00am',
          description: 'A program that involved the colaboration of CITAD and Jobberman organisation for entreprenuership awareness',
          host: 'Abdul-azeez YZ'
        },
        {id: '123ad',
          title: 'ILERIS March Edition',
          imageUrl: "data:image/jpeg;base64,",
          date: "12th March, 2021",
          venue: "CITAD, NSITF Building, Behind Trade Fair Complex Kano",
          time: '09:00pm',
          description: 'Alh. Abdullahi Nashe, MD, Mediwat School of Computer Science as guest speaker who will talk about how information technology infact the life of people nowadays',
          host: 'Jamilu Musa'
        }
      ],

      Notification: [],

      suggestionBox: []

  },

  mutations: {
    Notification(state, payload){
      state.Notification.push(payload)
    },
    
    UserInfo(state, userData){
      state.UserFullDetail = userData
    }
  },

  actions: {
    Notifications({commit}, payload){
      const notify = {
        title: payload.title,
        date: payload.date
      }
      commit('Notification', notify)
    },


    UserData({commit}, payload){
      const userData = {
        fullname: payload.fullname,
        username: payload.username,
        email: payload.email,
        address: payload.address,
        phone: payload.phone,
        organisation: payload.organisation,
        biography: payload.bio,
        password: payload.password,
        profilePic: payload.profilePic,

        registeredEvents: [],
        
        suggestionMsgs: []
      }
      // axios.post('http://localhost:3030/user/createusers', userData)
      //   .then(respondData => {
      //     console.log(respondData)
      //     state.UserFullDetail = respondData
      //   })
      commit('UserInfo', userData)
    }
  },  

  getters: {
    LoadedEvents (state){
      return state.LoadedEvents.sort((eventA, eventB) => {
        return eventA.date > eventB.date
      })
    },
    
    featuredEvent (state, getters){
      return getters.LoadedEvents.slice(0, 3)
    },
    
    LoadedEvent (state){
      return (eventId) => {
        return state.LoadedEvents.find((event) => {
          return event.id === eventId
        })
      }
    },
    
    sortedEventNotification (state){
      return state.Notification.sort((eventA, eventB) => {
        return eventA.date > eventB.date
      })
    },
    
    getUser (state){
      return state.UserFullDetail
    },

  },
  modules: {
    
  }
})
